import React, { ChangeEvent, useState, useEffect } from "react";

import {
  Button,
  DropDown,
  Input,
  ToggleBtnGroup,
} from "intelli-ui-components-library";
import style from "./server.module.scss";
import { AddIcon, DeleteIcon, EditIcon } from "../../assets/icons";
import { EnumData, ServerData } from "../../utils/constant/types";
import { RowData } from "./Server";
import useArray from "../../utils/hooks/useArray";

function TabList({
  editRowData,
  onClickAddServer,
}: {
  editRowData: RowData;
  onClickAddServer: (obj: any) => void;
}) {
  const [activeTab, setActiveTab] = useState("tab1");

  const handleTab1 = () => {
    // update the state to tab1
    setActiveTab("tab1");
  };

  const handleTab2 = () => {
    // update the state to tab2
    setActiveTab("tab2");
  };

  const handleTab3 = () => {
    // update the state to tab1
    setActiveTab("tab3");
  };

  const [selectedTab, setSelectedTab] = useState("url");
  const clickHandle = (e: any, val: any) => {
    setSelectedTab(val);
  };

  const [serverData, setServerData] = useState<RowData>({
    id: editRowData.id ?? "",
    selected: editRowData.selected ?? false,
    url: editRowData.url ?? "",
    description: editRowData.description ?? "",
    enums: editRowData.enums ?? [],
  });

  return (
    <div className={style["tablist-section"]}>
      <ToggleBtnGroup
        onToggle={(e) => setSelectedTab(e.target.value)}
        selectedTab={selectedTab}
        shouldSelectByDefault={true}
        borderBottom={true}
        disabled
        className={style["toggle-btn"]}
        styleObj={{ bgColor: "#0086ff", color: "#0086ff" }}
      >
        <ToggleBtnGroup.Btn
          value="url"
          className={selectedTab === "url" ? "active" : ""}
        >
          URL
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="desc"
          className={selectedTab === "desc" ? "active" : ""}
        >
          Description
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="enums"
          className={selectedTab === "enums" ? "active" : ""}
        >
          Enums
        </ToggleBtnGroup.Btn>
      </ToggleBtnGroup>

      <div className={style["tab-content"]}>
        {selectedTab === "url" ? (
          <Url
            value={serverData.url}
            handleChange={(val: string) =>
              setServerData({ ...serverData, url: val })
            }
          />
        ) : selectedTab === "desc" ? (
          <Description
            value={serverData.description}
            handleChange={(val: string) =>
              setServerData({ ...serverData, description: val })
            }
          />
        ) : selectedTab === "enums" ? (
          <Enums
            listOfEnums={serverData.enums}
            handleChange={(arr: EnumData[]) => {
              setServerData({ ...serverData, enums: arr });
            }}
          />
        ) : (
          ""
        )}
      </div>
      <Button
        className={style["done-btn"]}
        onClick={() => onClickAddServer(serverData)}
      >
        Done
      </Button>
    </div>
  );
}

const Url = ({
  value,
  handleChange,
}: {
  value: string;
  handleChange: (val: string) => void;
}) => {
  return (
    <Input
      value={value}
      placeholder={"Enter Url"}
      onChange={(event) => handleChange(event.target.value)}
    />
  );
};
const Description = ({
  value,
  handleChange,
}: {
  value: string;
  handleChange: (val: string) => void;
}) => {
  return (
    <Input
      value={value}
      placeholder={"Enter Description"}
      onChange={(event) => handleChange(event.target.value)}
    />
  );
};

const Enums = ({
  listOfEnums,
  handleChange,
}: {
  listOfEnums: EnumData[];
  handleChange: (val: EnumData[]) => void;
}) => {
  const { array, push, edit, remove } = useArray(listOfEnums);
  useEffect(() => {
    return () => {
      handleChange(array);
    };
  }, []);
  return (
    <div className={style["enums-list"]}>
      {array.length > 0 &&
        array.map((obj: EnumData, index: number) => {
          return (
            <div className={style["enum-row"]}>
              <Input
                value={obj.value}
                placeholder={"Enter Enum Value"}
                onChange={(event) => {
                  const { value: newValue } = event.target;
                  let newObj = {
                    ...obj,
                    value: newValue,
                  };
                  edit(index, newObj);
                  handleChange(array);
                }}
              />
              <div>
                <Button
                  size="md"
                  round="round"
                  variant="outline"
                  className={style["buttons"]}
                  onClick={() => {
                    remove(index);
                    handleChange(array);
                  }}
                >
                  <DeleteIcon />
                </Button>
                {index === array.length - 1 ? (
                  <Button
                    size="md"
                    round="round"
                    variant="outline"
                    className={style["buttons"]}
                    onClick={() => push({ value: "" })}
                  >
                    <AddIcon fill={"#4b4b4b"} />
                  </Button>
                ) : null}
              </div>
            </div>
          );
        })}
      {array.length === 0 ? (
        <Button
          size="md"
          round="round"
          variant="outline"
          className={style["buttons"]}
          onClick={() => push({ value: "" })}
        >
          <AddIcon fill={"#4b4b4b"} />
        </Button>
      ) : null}
    </div>
  );
};

export default TabList;
